import React, { Component } from 'react';
import "./footerText.scss"

class FooterText extends Component {
    render() { 
        return (
            <div className="footerText">
                "Blinkit" is owned &amp; managed by "Blinkit Commerce Private Limited" (formerly known as Grofers India Private Limited) and is not
        related, linked or interconnected in whatsoever manner or nature to "GROFER.COM" which is a real estate services business operated by "Redstone Consultancy Services Private Limited" 
            </div>
        );
    }
}

export default FooterText;
